(527, 14, 207, '', 'AMERICAN BURGUER', 'Hamburguesa casera de carne, muzzarella, panceta crocante y pickles en conserva, salsa barbacoa, con ensalada coleslaw (repollo blanco, morado, zanahoria y aderezo a base de mayonesa).', '450.00', '0.00', 0, 0, 0, 0, 0, 0),
(528, 14, 207, '', 'VEGGIE BURGUER', 'Hamburguesa casera de espinaca y quínoa, hummus de garbanzos, tomates cherry y hongos en escabeche, con vegetales en tempura (zucchini, brócoli y kale), con mayonesa de berenjena (sin huevo).', '450.00', '0.00', 0, 0, 0, 0, 0, 0),
(529, 14, 207, '', 'LOMO', 'Lomo lechuga, tomate y condimentos', '450.00', '300.00', 0, 0, 0, 0, 0, 0),
(530, 14, 208, '', 'BIFE DRY AGED', 'Carne madurada en seco a través de un proceso que le otorga la mayor suavidad y maximiza su sabor.\r\nEs el corte ideal para un paladar fino que busca la excelencia en degustación y lo acompaña con un vino Premium de nuestra selección.\r\nPodés pedirlo de 400grs y 800grs.', '450.00', '370.00', 0, 0, 0, 0, 0, 0),
(531, 14, 208, '', 'BROCHETTE DE LOMO', 'Brochette de lomo con cebolla, morrones y panceta ahumada\r\nUn sabor delicioso y una buena opción para comer carne y vegetales.\r\nLa combinación de este tipo de alimentos y su cocción a las brasas le dan un sabor especial y llevan al comensal a vivir una experiencia única.', '365.00', '0.00', 0, 0, 0, 0, 0, 0),
(532, 14, 208, '', 'ASADO DE NOVILLO CORTE AMERICANO', 'Es el producto de cortar los bifes angostos a través del hueso más largo, en tiras de una pulgada de espesor.La carne no es otra que la del bife de chorizo.\r\nPor lo general mantiene una buena textura y un sabor satisfactorio al paladar.', '430.00', '0.00', 0, 0, 0, 0, 0, 0),
(533, 14, 208, '', 'MOLLEJAS GRILLADAS', 'Para una entrada en calor antes del plato principal, muy ricas para comerlas crocantes con limón y sal.\r\nSon la tentación de cualquier persona que gusta de las buenas parrilladas y tienen un paladar muy afilado por su experiencia.', '470.00', '400.00', 0, 0, 0, 0, 0, 0),
(534, 14, 208, '', 'BONDIOLA DE CERDO', 'Bondiola de cerdo mechada con panceta ahumada.\r\nDos sabores se juntan para potenciarse y lograr algo inigualable.\r\nUna comida para degustar con un buen vino tinto y comprender los aromas y texturas que se logran a partir de la combinación de los ingredientes de este plato.\r\n\r\n', '425.00', '0.00', 0, 0, 0, 0, 0, 0),
