(1262, 66, 458, '', 'DESAYUNO / MERIENDA PREMIUM BOX INFANTIL', 'Tenemos unas cajas de madera con una exquisita seleccion de productos para el desayuno o merienda de nuestros pequeños. Contiene:\r\n\r\n1 chocolatada en cajita individual\r\n1 pastafrolita de membrillo o de coco y dulce de leche\r\n4 conitos con dulce de leche bañados en chocolate\r\nBolsita con galletitas pepas de membrillo\r\nBolsita con 6 alfajorcitos de maicena\r\n2 facturas de jamón y queso\r\n2 medialunas\r\n1 madalena rellena con dulce de leche\r\n4 mini sandwich triple de jamón cocido y queso\r\n1 caja de madera contenedora con logo impreso y tarjetita de felicitaciones.', '1500.00', '0.00', 0, 0, 0, 0, 0, 0),
(1263, 66, 458, '', 'CAJA SELECCIÓN DE MASITAS SECAS', 'Caja de cartulina forrada, con divisiones internas para separar la variedad de masas que incluye. La misma contiene nuestros exquisitos florentinos, cigarritos con dulce de leche, alfajorcitos con forma de corazón, conitos bañados en chocolate rellenos con dulce de leche y alfajorcitos con un toque de canela, con dulce de leche. Podemos cambiar esta selección por la que vos prefieras. Incluye una tarjeta de felicitaciones que puede personalizarse con un breve mensaje.', '950.00', '0.00', 0, 0, 0, 0, 0, 0),
(1264, 66, 457, '', 'MASAS SECAS X 1KG', 'Surtido de masas finas secas: palmeritas, cañoncitos con dulce de leche, cigarritos con dulce de leche, alfajorcitos de dulce de leche bañados en chocolate blanco, alfajorcitos de dulce de leche bañados en chocolate negro, alfajorcitos de dulce de leche bañados en chocolate negro con dulce de frambuesas, alfajorcitos de nuez con dulce de leche, alfajorcitos de miel, masitas de coco y dulce de leche, alargaditos con dulce de leche bañados en chocolate blanco y en chocolate negro, conitos de dulce de leche con chocolate blanco y chocolate negro, corazoncitos de nuez con dulce de leche, alfajorcitos corazón con chocolate blanco y chocolate negro, galletitas medialuna bañadas en chocolate blanco y negro, galletitas con crocante de almendras, galletitas combinadas chocolate y vainilla circulares, galletitas bañadas en chocolate negro con crocante de almendras, galletitas bañadas en chocolate blanco con coco, trufas con chocolate blanco, trufas con chocolate negro y cacao, merenguitos con dulce de leche, galletitas y/o masitas especiales de época. ', '1200.00', '0.00', 0, 0, 0, 0, 0, 0),
