(1346, 81, 508, '', 'FINCA LA LINDA EXTRA BRUT ROSE', 'Este espumante llama la atención por su color rosado con perfil púrpura, al igual que por sus aromas sueltos y agradables a fruta roja, especialmente a frutilla y cereza negra. Su entrada en el paladar repite las notas típicas de la variedad Malbec, que permanecen y aportan la clave de su carácter. Una acidez muy fina suma jugosidad y frescura a su muy buena combinación y coherencia entre nariz y boca. Compacto y persistente en su paso por el paladar.', '580.00', '453.00', 0, 0, 0, 0, 0, 0),
