(1370, 83, 530, '', 'STAPHYLE PREMIUM CABERNET SAUVIGNON', 'Vino de color púrpura con matices granate brillantes. Aromas  complejos recuerdan el ají, morrón, frambuesa con un toque de vainilla propio de su guarda en barricas.', '490.00', '0.00', 0, 0, 0, 0, 0, 0),
(1371, 83, 530, '', 'VÁSTAGO DE GEA MALBEC ROSÉ', 'Atractivo, de color granate, con destellos elegantes. Prevalece la identidad varietal, advirtiéndose un singular perfume a frutillas, cerezas, frambuesas y rosas silvestres.\r\nIdeal en los aperitivos y o para acompañar  mariscos, platos agridulces, y pastas con salsa bechamel.', '460.00', '0.00', 0, 0, 0, 0, 0, 0),
(1372, 83, 530, '', 'IRIS MALBEC', 'Vino atractivo, joven, muy frutal, ciruelas y cerezas recién cortadas, son las notas de predominio que identifican su juventud y elegancia. En boca se torna suave, agradable y envolvente.', '390.00', '0.00', 0, 0, 0, 0, 0, 0),
(1373, 83, 531, '', 'SEGURA VIUDAS RESERVA HEREDAD', 'Reserva Heredad fue creado para marcar estilo en el mundo de los espumosos de alta gama. Para ello se seleccionaron sólo los mejores vinos de cada cosecha que posteriormente envejecerán en botella en contacto con sus lías durante más de 24 meses. La crianza termina cuando el experto le da el toque mágico a cada botella con el “poignettage”, giro de muñeca que intensifica el contacto de las lías con el vino, dando así un bouquet más complejo.', '3600.00', '2560.00', 0, 0, 0, 0, 0, 0),
