(1558, 91, 593, '', 'CUIDADO DE NUESTROS PRODUCTOS', 'Para poder disfrutar de una mejor experiencia con nuestros productos, te recomendamos tener en consideración los siguientes Tips que hacen a una mejor conservación de los mismos:\r\n\r\n\r\nRango de temperatura ideal: es 20ºC+/-2ºC con un máximo de 24ºC.\r\n\r\n\r\nTipo de ambiente recomendado: limpio, alejado de fuentes de calor y productos químicos ya sea de limpieza, perfumería, insecticidas, etc.\r\n\r\n\r\nHumedad máx. 60%.\r\n\r\n\r\n¿Puedo Freezar los productos? Los productos pueden congelarse (siempre envueltos) y deben ser descongelados en la heladera (para que el ascenso de la Temperatura sea paulatino), dentro del mismo envoltorio en el que fue descongelado.\r\n\r\n\r\n¿Qué ocurre si vuelvo de vacaciones con Productos Havanna? Si te vas de vacaciones y compras nuestros productos, recordá no guardarlos en el baúl o luneta, ya que son las zonas más cálidas, lo ideal es que viaje en la cabina donde hay aire acondicionado (si es que el vehículo cuenta con él).\r\nCómo se recomienda guardar los productos Havanna en la alacena de nuestro hogar:\r\nLa mejor manera de cuidar los productos Havanna si se van a almacenar en una alacena, es dentro de una bolsa ziploc, u otro envase similar, cerrado herméticamente.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1559, 91, 582, '', 'GALLETITAS DE LIMÓN CON CHOCOLATE', 'Características:\r\nTentadoras galletitas horneadas rellenas con la más suave crema sabor a limón, cubiertas de chocolate semi amargo.\r\n\r\nPresentación:\r\nIndividual - Caja x12', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1560, 91, 592, '', 'BARRITAS CHOCOLATE CON LECHE', 'CHOCOLATE CON LECHE\r\nPresentación:\r\nCaja x6 / x12 ', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1561, 91, 590, '', 'LATTES', 'Latte de Dulce de leche: Espresso, leche con salsa de dulce de leche, crema y salsa de dulce de leche Havanna.\r\n\r\nLatte Chocolate y Avellana: Espresso con avellana, leche, crema y pedacitos de chocolate Havanna.\r\n\r\nLatte Chocolate Negro Latte: Espresso, leche con chocolate, crema y pedacitos de chocolate negro Havanna.\r\nLatte Chocolate Blanco: Espresso, leche con chocolate, crema y pedacitos de chocolate blanco Havanna.\r\n\r\nLatte Vainilla: Espresso con vainilla y leche.\r\n\r\nLatte Almendras: Espresso con almendras y leche.\r\n\r\nLatte Caramelo:Espresso con caramelo y leche.', '150.00', '0.00', 0, 0, 0, 0, 0, 0),
