(1671, 101, 635, '', 'BIOSMOTIC WATER BOOSTER', 'Loción sedosa formulada con un innovador sistema biotecnológico bifuncional osmoprotector hidratante. \r\nBrinda hidratación instantánea, prolongada y duradera. Además contiene Carrageninas extraídas de algas de aguas profundas que ayudan a mejorar la elasticidad y el aspecto global de la piel. Aplicar sobre la piel limpia del rostro. Repetir cada vez que se desee.', '1278.00', '1065.00', 0, 3, 0, 0, 0, 0),
