(1676, 101, 635, '', 'AQUASHOT CREMA FACIAL HIDRATANTE', 'Crema liviana que proporciona una hidratación intensa y duradera. \r\nAyuda a recuperar, equilibrar y mantener los niveles de hidratación. Deja la piel radiante, suave y elástica. Contiene activos de alta tecnología que, según la sequedad del medioambiente, incrementar su eficacia para retener y equilibrar el agua en la piel. Indicada para todo tipo de piel. Ideal para tratamiento preventivo para pieles jóvenes.', '1200.00', '1000.00', 0, 0, 0, 0, 0, 0),
