(1768, 103, 647, '', 'HELADERA EXHIBIDORA DULCENEA', '• Cúpula de vidrio frente y tapa superior en termopanel de 2 vidrios templados serigrafiados.\r\n• Laterales de vidrio serigrafiados.\r\n• Puerta corrediza trasera de acrílico.\r\n• Iluminación led.\r\n• Gabinete exterior en chapa prepintada color negro.\r\n• Interior en chapa de acero 4.30 brillante.\r\n• Aislación en poliuretano inyectado 40 Kg/m3 libre CFC.\r\n• Mesada de trabajo en acero inoxidable AISI 304.\r\n• Sistema de refrigeración por aire forzado.\r\n• Bandejas e interior en chapa prepintada color gris.\r\n• Perfiles de chapa galvanizada Nº 20.\r\n• Revestimiento de frente en chapa prepintada color negro.\r\n• Zócalo inferior color gris.\r\n• Patines reforzados regulables.\r\n• Paragolpes de protección gris con vira negra de PVC.\r\n\r\nAlto (mm) 1300\r\nLargo (mm) 1200\r\nProfundidad (mm) 1030\r\nPotencia (HP) 1/3\r\nRango de temperatura + 3º C\r\nTensión (V) 220', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1769, 103, 648, '', 'CAMARA BAJA TEMPERATURA 100 MM', 'PRECIO X M2\r\nGabinete de cámara frigorífica modular con paneles conformados e inyectados en poliuretano con una aislación de 100 mm. de espesor para media temperatura, densidad de 40 kg/m3.\r\n\r\nRevestimiento exterior e interior chapa blanca, encastre de paneles tipo macho-hembra, montados sobre zócalo sanitario. Puerta Batiente de idénticas características al panel, los herrajes de la misma serán recubiertos con pintura epoxi sanitaria .\r\n\r\nIluminación mediante tubo fluorescente en compartimiento estanco para evitar presencia de humedad. \r\n\r\n CON  PISO .', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1770, 103, 646, '', 'BALANZA DIGITAL KRETZ NOVEL ECO 2 30KG', 'La practicidad de la tecla Tara\r\nAunque es solo una tecla, convierte la balanza en una herramienta de trabajo práctica, que posibilita restar el peso del recipiente que contiene el producto y alcanzar la medida exacta.\r\n\r\n450 códigos PLU disponibles\r\nLos códigos PLU te acercan múltiples beneficios. Por un lado, vas a lograr simplificar las operaciones de la caja registradora y del control de inventario. Pero también, vas a minimizar errores y garantizar que quienes compren paguen el precio correcto.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1771, 103, 644, '', 'COCINA INDUSTRIAL', 'Exterior de acero inoxidable esmerilado\r\nInterior en chapa enlozada\r\nBandejas antiderrame de acero inoxidable brillante\r\nRejillas de fundición de hierro\r\nQuemadores de fundición de aluminio con tapa enlozada\r\nAislado con lana de vidrio\r\nEstructura en hierro ángulo en piso, puerta y marco\r\nMarco superior en hierro angulo 1/4\r\nPiso de ladrillos refractarios\r\nPirometro altamente sensible montado sobre puerta y conectado con el sector interno de la cámara de cocción\r\nRobinetes industriales de bronce\r\nPerillas de baquelita térmica\r\nPuerta con mango de madera montado sobre soportes de aluminio\r\nBisagras de puerta reforzadas\r\nQuemador del horno de caño redondo 7/8x 1,2mm. de espesor\r\nPlancha bifera lisa superpuesta autoportante en chapa DD laminada en frío 3/16\" de espesor\r\nCarlitero-tostador\r\nFreidor con capacidad 8Lts.\r\nApto para gas natural o envasado\r\nIncluye pinza carlitera\r\nIncluye canasto\r\nIncluye dos parrillas\r\nVálvula de seguridad en horno, plancha bifera y freidora', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
