(2888, 129, 820, '', 'TILO', 'El nombre cientifico de la flor de tila es \"tilia\", pero ha sido llamada el \"néctar de los reyes\" desde la Antigüedad debido a sus grandes beneficios para con la salud humana. Desde tiempos muy remotos ha sido utilizada como remedio casero en la cura de diferentes afecciones.\r\n\r\nDesde dolores de cabeza, trastornos digestivos, para tratar de calmar el sistema nervioso, este sedante suave ha sido utilizado por los nativos americanos para mejorar la salud y también por los europeos durante la Edad Media.', '350.00', '0.00', 0, 0, 0, 0, 0, 0),
