(3638, 145, 988, '', 'MONSTER TRADICIONAL / MANGO', 'Abre un lata de Monster Energy, la bebida más energética en el planeta. Es la combinación ideal de ingredientes y contiene la proporción adecuada para hacer el trabajo que sólo Monster puede. Monster tiene un sabor intenso pero suave. Atletas, músicos, anarquistas, estudiantes, guerreros de la carretera, roqueros, intelectuales, los modernos y a los motociclistas les encanta.\r\n\r\n', '100.00', '0.00', 0, 0, 0, 0, 0, 0),
