(3641, 145, 975, '', 'LOLA MONTES', 'Uvas provenientes de Lujan de Cuyo, Mendoza. Es frutado, ligero, con dejos de frambuesa, ciruela y cassis. De color vivo y brillante, un excelente vino para cualquier ocasión y momento , descontracturado y casual, para compartir con amigos.', '220.00', '0.00', 0, 0, 0, 0, 0, 0),
(3642, 145, 975, '', 'FRIDA', 'En esta flamante línea, que propone “la aventura de encontrarse”, no podía faltar el Malbec. Elaborado con uvas de Ugarteche, de aromas intensos y equilibrados. Con buena frescura que sostiene el paladar y un carácter típico de frutas rojas algo maduras. De texturas amables y final especiado. Pensado para acompañar pastas.', '220.00', '0.00', 0, 0, 0, 0, 0, 0),
(3644, 145, 975, '', 'MANDALA', 'Mandala es una flamante línea de vinos que no quiere ser reconocida por sus atributos vínicos, sino por su concepto. “State of Wine, state of mind”; más que un nuevo estilo de vinos, un estilo de vida. Nacieron con el objetivo de conquistar paladares jóvenes, a partir de una marca impactante, una imagen limpia y moderna, botellas con práctica tapa a rosca, y un mensaje que rompe con la tradición.\r\n\r\nLos Mandala son para disfrutar a toda hora, pensados para esos grupos de amigos que se juntan a compartir momentos, ya sea alrededor de una pileta, en una quinta, en la playa, en un balcón o en una terraza.', '240.00', '0.00', 0, 0, 0, 0, 0, 0),
