(4555, 164, 1163, '', 'CREMA DE DÍA CON FPS 30 TIMEWISE', 'Esta crema restauradora de la hidratación ayuda a retrasar los signos visibles del envejecimiento. Además proporciona protección UVA/UVB de alto espectro.\r\n\r\nBeneficios adicionales:\r\nIncluye nuestro complejo pendiente de patente Age Minimize 3D™.\r\nAyuda a mejorar la elasticidad de la piel.\r\nIlumina la piel y ayuda a unificar el tono de la piel.\r\nAyuda a que la piel tenga un aspecto más joven y deja la piel suave y lisa.\r\nUtiliza la Crema de Noche TimeWise® Age Minimize 3D™ para 24 horas de hidratación.', '2222.00', '0.00', 1, 0, 0, 0, 0, 0),
(4556, 164, 1165, '', 'TRUE ORIGINAL® COLONIA EN SPRAY', 'Este aroma limpio y fresco es perfecto para el hombre valiente que sigue su pasión hasta la próxima aventura, y que se compromete con su familia, amigos y el mundo que le rodea.\r\n\r\nLas notas altas incluyen limón y manzana Fuji.\r\nLas notas medias incluyen ámbar y madera de cedro.\r\nLas notas bajas incluyen pachulí.\r\nModerno y original envase.\r\n', '3333.00', '0.00', 0, 0, 0, 0, 1, 0),
(4557, 164, 1165, '', 'MK HIGH INTENSITY™ SPORT COLONIA EN SPRAY', 'Esta fragancia fresca y vigorizante estimula tus sentidos con un aroma que inspira tu lado más aventurero.\r\n\r\nLas notas altas incluyen baya y bergamota, cortadas con un toque de oxígeno líquido.\r\nLas notas medias incluyen cardamomo fresco, menta y pimienta violeta.\r\nLas notas bajas incluyen abedul y ámbar.\r\n', '3333.00', '0.00', 0, 0, 0, 0, 1, 0),
(4558, 164, 1166, '', 'CITYSCAPE™ EAU DE PARFUM', 'Elegancia sin esfuerzo. Inspirada en las ciudades más glamurosas y sofisticadas del mundo.\r\n\r\nLas notas más altas incluyen bergamota, pimienta rosa, grosella, albaricoque y hojas de violeta.\r\nLas notas medias están compuestas de esencia de orquídea Phantomia y peonías.\r\nLas notas bajas son madera de sándalo, angélica y ámbar.\r\nEl regalo más estiloso para ella.\r\n', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(4559, 164, 1166, '', 'THINKING OF YOU® EAU DE PARFUM', 'Convierte un instante en un recuerdo inolvidable con un aroma que captura las emociones que nos conectan a todos, y que también brinda el regalo perfecto.\r\n\r\nFragancia afrutada de flores orientales que te hace sentirte bien\r\nPrecioso colgante para guarda\r\nEl diseño único de la caja permite escribir una nota especial en su interior.\r\n', '2222.00', '0.00', 0, 0, 0, 0, 1, 0),
(4560, 164, 1167, '', 'LÁPIZ DE LABIOS GEL SEMI-SHINE MARY KAY®', 'Color duradero. Efecto aterciopelado. ¡Lo que tus labios estaban esperando!\r\nLarga duración que no reseca tus labios.\r\nPigmentación intensa para un color excepcional.\r\nFórmula ligera en gel.\r\nTecnología gel \"Cushion Matrix\" con un acabado cremoso para un efecto de labios jugosos.\r\nPotenciadores ópticos que reducen la apariencia de las imperfecciones.', '2222.00', '0.00', 0, 0, 0, 0, 0, 0),
