(4565, 166, 1168, '', 'CERVEZA PATAGONIA', 'El sabor de la caramelización de las maltas puede recordarnos a sabores de cebollas caramelizadas, salsas agridulces, salsas de caramelo en postres cremosos. Otros platos infalibles son las carnes rojas grilladas, hamburguesas gourmet, batatas asadas. Su sutil sabor dulce la hace perfecta para acompañar agridulces.', '333.00', '0.00', 1, 0, 2, 0, 0, 0),
