(4567, 166, 1170, '', 'EL ENEMIGO MALBEC', 'FICHA TÉCNICA\r\nBODEGA: Aleanna  \r\nTIPO: Tinto\r\nVARIEDAD: Malbec \r\nCORTE: Malbec 89 %  Cabernet Franc 6 % Petit Verdot 5 %\r\nALCOHOL: 13,9 %\r\nUBICACION / ORIGEN\r\nGualtallary. Provincia de Mendoza, Argentina.\r\nCRIANZA / BARRICADO\r\n', '2070.00', '1799.00', 0, 0, 3, 0, 0, 0),
(4568, 166, 1170, '', 'ESCORIHUELA GASCON MALBEC', 'FICHA TÉCNICA\r\nBODEGA: Escorihuela Gascon\r\nTIPO: Tinto\r\nVARIEDAD: Malbec\r\nCORTE: Malbec 100% \r\nALCOHOL: 14 %\r\nUBICACION / ORIGEN\r\nAgrelo, La Consulta, Vistalba. Provincia de Mendoza, Argentina. WC\r\nCRIANZA / BARRICADO\r\nAnejado 8 meses en barricas. 50% roble francés, 50% roble americano. Cosecha A mano y fermentación en tanques de acero inoxidable, apenas descobajado, se realiza una maceración prefermentativa a 10º C durante 72 hs. Luego la fermentación alcohólica se conduce haciendo un pico de 28º como máximo, finalizando a una temperatura de 23-24º C para obtener todos los aromas frutales.', '1080.00', '689.00', 0, 0, 4, 0, 0, 0),
(4569, 166, 1171, '', 'NIETO SENETINER BRUT NATURE', 'FICHA TÉCNICA\r\nBODEGA:  Nieto Senetiner \r\nTIPO: Espumante\r\nVARIEDAD: Pinot Noir\r\nCORTE: Pinot Noir 100 %   \r\nALCOHOL: 12\r\nUBICACION / ORIGEN\r\nTacuil, Sudoeste Valles Calchaquíes. Provincia de Salta, Argentina\r\nCRIANZA / BARRICADO\r\nVinificación Blanc de Noir, es decir una uva tinta vivificada como blanca. Los hollejos de la uva tienen un leve contacto con el mosto, obteniendo la delicada cloración asalmonada. Método de elaboración Charmat.', '650.00', '444.00', 0, 0, 5, 0, 0, 0),
