(4614, 170, 1194, '', 'ANTI MOSQUITOS CHICCO', 'Dispositivo Portátil Ultrasonido Anti - Mosquitos\r\nIdeal para la vida al aire libre\r\nEl dispositivo anti-mosquito Chicco actúa mediante ultrasonidos que molestan a los mosquitos, pero no causa ningún efecto indeseado a la gente.\r\nParticularmente conveniente para la vida al aire libre, viene con un práctico clip para sujetar al cochecito. Funciona con una pila alcalina de 1,5 V tiene una duración de 100 horas.', '1499.00', '0.00', 1, 0, 0, 0, 0, 0),
