(4620, 172, 1200, '', 'DON VALENTÍN LACRADO TINTO', 'FICHA TÉCNICA\r\nBODEGA: Bianchi   \r\nTIPO: Tinto\r\nVARIEDAD: Blend\r\nCORTE: Malbec  Merlot  Syrah  Cabernet Sauvignon  \r\nALCOHOL: 15 %\r\nUBICACION / ORIGEN\r\nFinca Asti, Finca Doña Elsa, Finca Las Paredes, y uvas provenientes de viñedos en la zona de San Rafael. Provincia de Mendoza, Argentina.\r\nCRIANZA / BARRICADO\r\nCosecha manual Molienda, fermentación clásica en maceración con los hollejos Descube, prensado y trasiegos autoclarificantes. Añejado en tanques de inox durante dos años. Estabilizado, filtrado y embotellado.', '290.00', '190.00', 0, 0, 0, 0, 0, 0),
(4621, 172, 1201, '', 'EMILIA NIETO SENETINER EXTRA BRUT', 'FICHA TÉCNICA\r\nBODEGA: Nieto Senetiner\r\nTIPO: Espumante\r\nVARIEDAD: Moscatel\r\nCORTE: Maoscatel 100 %\r\nALCOHOL: 12,1 %\r\nUBICACION / ORIGEN\r\nProvincia de Mendoza, Argentina.\r\nCRIANZA / BARRICADO\r\nPreparación del vino base suave prensado de las uvas con estricto control de temperatura, para mantener los frescos aromas varietales. Fermentación en frío, 16 a 18 grados, durante 21 días. Interrupción de la fermentación con reducción de la temperatura, para preservar los azúcares naturales de las uvas. Toma de espuma assemblage de vinos base y ubicación en tanques de acero inoxidable. Adición de levaduras seleccionadas. Toma de espuma a 15-18 grados, durante 30 días.', '500.00', '369.00', 0, 0, 0, 0, 0, 0),
