(5052, 184, 1291, '', 'ITALFLEX 30K', 'Italflex es un revestimiento acrílico texturable de base acuosa, con el agregado de minerales seleccionados y pigmentos que le confieren la apariencia de la piedra natural. Es ideal para disimular las imperfecciones de las superficies tratadas. Se presenta listo para usar y es de fácil y rápida aplicación. Al secar forma una película protectora impermeable de excelente flexibilidad y adherencia, resistente a los rayos UV y a los agentes atmosféricos. Admite su aplicación directamente sobre grueso alisado, reemplazando al revoque fino y a la pintura, permitiendo un ahorro significativo en costos de material y tiempos de mano de obra. Disponible en textura fina y mediana.\r\n\r\nINTERIOR | EXTERIOR\r\nEs ideal para ser aplicado sobre revoques gruesos fratasados, revoques finos, placas de yeso, hormigón, madera, bloques de hormigón celular curado, sistema E.I.F.S., etc.', '5200.00', '0.00', 0, 0, 0, 0, 0, 0),
(5053, 184, 1291, '', 'ITALFLEX CRETA 30K', 'Italflex Creta es un revestimiento acrílico texturable de base acuosa, con el agregado de minerales seleccionados y pigmentos que le confieren la apariencia de la piedra natural. Es ideal para disimular las imperfecciones de las superficies tratadas. Se presenta listo para usar y es de fácil y rápida aplicación. Al secar forma una película protectora impermeable de excelente flexibilidad y adherencia, resistente a los rayos UV y a los agentes atmosféricos. Admite su aplicación directamente sobre grueso alisado, reemplazando al revoque fino y a la pintura, permitiendo un ahorro significativo en costos de material y tiempos de mano de obra. Disponible en textura fina y mediana con el agregado de mica que le aporta toques de brillo natural.\r\n\r\nINTERIOR | EXTERIOR\r\nEs ideal para ser aplicado sobre revoques gruesos fratasados, revoques finos, placas de yeso, hormigón, madera, bloques de hormigón celular curado, sistema E.I.F.S., etc.', '5450.00', '0.00', 0, 0, 0, 0, 0, 0),
(5054, 184, 1291, '', 'RUSTIFLEX 30K', 'Rustiflex es un revestimiento acrílico de textura fina, flexible, impermeable al agua de lluvia y resistente a los cambios climáticos. Reemplaza al fino y a la pintura en obra nueva o a refaccionar, logrando un importante ahorro de materiales y mano de obra.\r\n\r\nINTERIOR | EXTERIOR\r\nIdeal para ser aplicado sobre revoques gruesos fratasados, revoques finos, placas de yeso, hormigón, madera, bloques de hormigón celular curado, sistema E.I.F.S., etc.\r\n', '5250.00', '0.00', 0, 0, 0, 0, 0, 0),
(5055, 184, 1291, '', 'STUCCO 30K', 'Raper Stucco es un revestimiento decorativo continuo de acabado símil mármol. Revive las terminaciones antiguas de las construcciones típicas de Venecia con tecnologías innovadoras de la actualidad, dejando un efecto en la pared liso y brillante como un mármol pulido, con elegantes efectos esfumados sobre un mismo tono que proveen belleza y estilo a los ambientes.\r\n\r\nINTERIOR\r\nEs un producto de uso interior y por tratarse de un acabado fino no disimula imperfecciones del sustrato, por ende es necesario que el mismo sea liso y de terminación prolija. Es ideal para aplicar en cualquier espacio interior donde se desee dar un detalle decorativo sobre las paredes, cielorrasos o columnas. No recomendable para ser aplicado en espacios húmedos o sobre superficies que puedan quedar en contacto con el agua.', '5800.00', '0.00', 0, 0, 0, 0, 0, 0),
(5056, 184, 1291, '', 'COSMOS 30K', 'Raper Cosmos es un revestimiento decorativo de base acrílica de efecto granito natural, ideal para crear ambientes de estilo moderno atentos a los mínimos detalles y valorizar las decoraciones de estilo clásico, ofreciendo un resultado estético elegante y de encanto sofisticado.\r\n\r\nINTERIOR | EXTERIOR\r\nEs un producto de alta resistencia a la abrasión, de excelente flexibilidad e impermeable, que por su textura gruesa es útil para disimular pequeñas imperfecciones sobre las superficies a tratar. Raper Cosmos es ideal para ser aplicado sobre revoques gruesos fratasados, revoques finos, placas de yeso, hormigón, madera, bloques de hormigón celular curado, etc.', '5800.00', '0.00', 0, 0, 0, 0, 0, 0),
(5057, 184, 1291, '', 'CUARZ 30K', 'Raper Cuarz es un revestimiento decorativo de base acrílica símil piedra con color incorporado, desarrollado con cargas naturales de cantera. Este aporta un aspecto cromático vistoso ideal para realizar detalles decorativos que generen ambientes modernos y descontracturados caracterizados por su originalidad.\r\n\r\nINTERIOR | EXTERIOR\r\nEs un producto de alta resistencia a la abrasión, de exelente flexibilidad e impermeable, que por su textura gruesa es útil para disimular pequeñas imperfecciones sobre las superficies a tratar. Raper Cuarz es ideal para ser aplicado sobre revoques gruesos fratasados, revoques finos, placas de yeso, hormigón, madera, bloques de hormigón celular curado, etc.', '5800.00', '0.00', 0, 0, 0, 0, 0, 0),
(5058, 184, 1291, '', 'GRAIN 30K', 'Raper Grain es un revestimiento decorativo de base acrílica que reproduce el aspecto típico del granito, caracterizado por micro-partículas sintéticas que generan el efecto de color y cristales brillantes que aportan un característico brillo superficial.\r\n\r\nINTERIOR | EXTERIOR\r\nEn espacios interiores es el producto ideal a la hora de buscar ambientes que se distingan por el diseño y exclusividad. En el exterior aporta un estilo sofisticado a las fachadas. Por tratarse de un acabado fino no disimula imperfecciones del sustrato, por ende es necesario que el sustrato sea liso y de terminación prolija.', '5800.00', '0.00', 0, 0, 0, 0, 0, 0),
(5059, 184, 1287, '', 'CASABLANCA PRO INTERIOR 20L', 'Latex interior de gran poder cubritivo, lavable y antihongos. ', '5450.00', '0.00', 0, 0, 0, 0, 0, 0),
