(5161, 142, 1349, '', 'CAJA SURTIDA (30 UNIDADES)', 'CAJA SURTIDA \r\n30 unidades de Molinillos de especias premium RUEDO\r\nIncluye:\r\n5 Mix de pimientas\r\n2 Mix pampeano\r\n2 Mix costa de mar\r\n2 Mix patagónico\r\n2 Mix norteño\r\n2 Mix cuyano\r\n2 Mix mesopotámico\r\n5 Sal del himalaya\r\n2 Sal Pampeana\r\n2 Sal Mesopotámica\r\n2 Sal norteña\r\n2 Sal Patagónica', '10000.00', '0.00', 0, 6, 0, 0, 1, 1),
(5162, 159, 1309, '', 'CAJA SURTIDA MOLINILLOS (7UNIDADES)', 'CAJA SURTIDA \r\n7 unidades de Molinillos de especias premium RUEDO\r\nIncluye:\r\nMix 4 Pimientas 90gr\r\nPimientas premium para darle a tus comidas el mejor picor, aroma y sabor.\r\nPimienta blanca, negra, rosa y verde\r\n\r\nMix Pampeano 65gr\r\nIdeal para carnes rojas. Contiene: orégano, pimentón dulce, semillas de ají, semillas de mostaza amarilla, perejil, ajo granulado, romero, tomillo y pimienta negra\r\n\r\nMix Costa de mar 65gr\r\nIdeal para Pescados. Contiene: perejil, escamas de cebolla, ajo granulado, ají picado grueso, pimienta blanca en grano, albahaca y eneldo.\r\n\r\nMix Patagónico 90gr\r\nAhumado ideal para darle todo el color, aroma y sabor al cordero, truchas o salmones. Contiene: ajo granulado, clavo de olor, semillas de ají, pimentón ahumado, coriandro, pimienta negra en grano y pimienta blanca.\r\n\r\nMix Mesopotámico: Una exclusiva combinación de especias puras para tus comidas. Contiene: Albahaca, tomillo, pimienta negra, pimienta blanca, ajo granulado, ají rojo, eneldo y perejil\r\nMix Cuyano: Una exclusiva combinación de especias puras para tus comidas. Contiene las siguientes especias puras: romero, oregano, aji colorado, curry, ajo granulado y tomillo\r\n\r\nMix Norteño: Una exclusiva combinación de especias puras para tus comidas.\r\nContiene las siguientes especias puras: pimienta negra, orégano, ají colorado, pimentón, romero y tomillo.\r\n\r\nSal del Himalaya 200gr.: Sal Rosada importada de Pakistán con muy buen hierro y baja en sodio. Sal mineral extraída de montaña, no de salar.\r\n', '2999.00', '0.00', 0, 0, 0, 0, 0, 0),
