(5252, 151, 1331, '', 'DIPLOMATURA EN ALFABETIZACION DIGITAL', 'DURACION 6 MESES <br>MODALIDAD ON LINE <br>FECHA DE INICIO INICIA YA <br>PUNTOS POR PROVINCIA Buenos Aires: 3 puntos ( RESFC-2018-4265-GDEBA-DGCYE / Dictamen Provincia de Buenos Aires N 10269 ) CABA: 2 puntos ( 28091425-MGEYA-DGPLEDU-18 ) Santa Fe: 28 puntos ( DECRETO-3029 / DECRETO-MODIFICATORIO-2552 ) Entre Ríos: 5 puntos ( 1000-13-CGE ) Río Negro: 0.20 puntos ( Resolución N 4413/18 ) Resto del País: Las Diplomaturas Superiores de la Facultad de Ciencias de la Educación de la Universidad FASTA son postítulos que se dictan de acuerdo a los considerandos de la Resolución del Consejo Federal de Educación N 117/10. Todas las Diplomaturas acreditan una duración mínima de 600 horas reloj. ', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(5253, 151, 1331, '', 'DIPLOMATURA EN DIRECCIÓN DE INSTITUCIONES EDUCATIVAS', 'DURACION 6 MESES <br>MODALIDAD ON LINE <br>FECHA DE INICIO INICIA YA Dictamen Provincia de Buenos Aires N 10269. En prov. de Buenos Aires: Otorga una bonificación de 3 puntos La presente Diplomatura con certificación universitaria cubre los aspectos básicos necesarios para la gestión de calidad de una institución educativa, junto con una visión actual del rol del director. La Diplomatura ofrece a través del abordaje de los grandes temas de la gestión conceptos, procedimientos y una guía de acción para analizar la práctica educativa, así como estrategias para promover procesos de participación, de supervisión pedagógica e innovación en las escuelas.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(5254, 151, 1331, '', 'DIPLOMATURA SUPERIOR EN EVALUACIÓN EDUCATIVA', 'DURACION 6 MESES <br>MODALIDAD ON LINE <br>FECHA DE INICIO INICIA YA  <br>PUNTOS POR PROVINCIA Buenos Aires: 3 puntos ( RESFC-2018-4265-GDEBA-DGCYE / Dictamen Provincia de Buenos Aires N 10269 ) CABA: 2 puntos ( 28091425-MGEYA-DGPLEDU-18 ) Santa Fe: 28 puntos ( DECRETO-3029 / DECRETO-MODIFICATORIO-2552 ) Entre Ríos: 5 puntos ( 1000-13-CGE ) Río Negro: 0.20 puntos ( Resolución N° 4413/18 ) Resto del País: Las Diplomaturas Superiores de la Facultad de Ciencias de la Educación de la Universidad FASTA son postítulos que se dictan de acuerdo a los considerandos de la Resolución del Consejo Federal de Educación N 117/10. Todas las Diplomaturas acreditan una duración mínima de 600 horas reloj.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(5255, 151, 1331, '', 'DIPLOMATURA EN EDUCACIÓN Y MEDIOS, SELECCIÓN Y EVALUACIÓN DE MEDIOS EDUCATIVOS', 'DURACION 6 MESES <br>MODALIDAD ON LINE <br>FECHA DE INICIO INICIA YA <br>PUNTOS POR PROVINCIA: Buenos Aires: 3 puntos ( RESFC-2018-4265-GDEBA-DGCYE / Dictamen Provincia de Buenos Aires N 10269 ) CABA: 2 puntos ( 28101431-MGEYA-DGPLEDU-18 ) Santa Fe: 28 puntos ( DECRETO-3029 / DECRETO-MODIFICATORIO-2552 ) Entre Ríos: 5 puntos ( 1000-13-CGE ) Río Negro: 0.20 puntos ( Resolución N 4413/18 ) Resto del País: Las Diplomaturas Superiores de la Facultad de Ciencias de la Educación de la Universidad FASTA son postítulos que se dictan de acuerdo a los considerandos de la Resolución del Consejo Federal de Educación N 117/10. Todas las Diplomaturas acreditan una duración mínima de 600 horas reloj. ', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(5256, 151, 1331, '', 'DIPLOMATURA EN PROBLEMAS ACTUALES DE LA GESTIÓN INSTITUCIONAL EDUCATIVA', 'DURACION 6 MESES <br>MODALIDAD ON LINE <br>FECHA DE INICIO INICIA YA <br>PUNTOS POR PROVINCIA: Buenos Aires: 3 puntos ( RESFC-2018-4265-GDEBA-DGCYE / Dictamen Provincia de Buenos Aires N 10269 ) CABA: 2 puntos ( 28108277-MGEYA-DGPLEDU-18 ) Santa Fe: 28 puntos ( DECRETO-3029 / DECRETO-MODIFICATORIO-2552 ) Entre Ríos: 5 puntos ( 1000-13-CGE ) Río Negro: 0.20 puntos ( Resolución N 4413/18 ) Resto del País: Las Diplomaturas Superiores de la Facultad de Ciencias de la Educación de la Universidad FASTA son postítulos que se dictan de acuerdo a los considerandos de la Resolución del Consejo Federal de Educación N 117/10. Todas las Diplomaturas acreditan una duración mínima de 600 horas reloj. El reconocimiento u otorgamiento de puntaje docente, es facultad exclusiva de cada jurisdicción provincial, ', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(5257, 151, 1331, '', 'DIPLOMATURA EN INFANCIAS Y ADOLESCENCIAS DESDE UNA PERSPECTIVA DE GÉNERO, DERECHOS Y AUTOCUIDADO', 'DURACION 6 MESES <br>MODALIDAD ON LINE <br>FECHA DE INICIO INICIA YA<br> Esta diplomatura propone dar a conocer la importancia de incorporar la ESI a las prácticas educativas lo que exige redefinir los roles en los distintos ámbitos y niveles institucionales, creando nuevas herramientas conforme los niños, niñas y adolescentes (NNA) de hoy, atravesados por distintas realidades y tensiones sociales. El marco que legisla la enseñanza de la educación sexual integral está sustentado en la ley 26150, incorporándola a todos los niveles educativos. La provincia de Buenos Aires promulga la ley 13066/1 y la ley 14744, y a nivel Nacional promoviendo los derechos, la salud y la prevención se enmarca en las leyes 25673, 23798, 26485 y 26061/2 y Ley N 23.849/3 La escuela es un espacio donde se transmiten valores, conocimientos e información con mayor sistematicidad durante la infancia, ', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
